@catjoanli @iamDCinvestor @AlchemixFi @scupytrooples I still struggle to find the innovation here.
If I lend ETH to Compound or AAVE and borrow USDC against, I will earn interest on ETH that I can use to pay my debt (+ interests) on the USDC loan. 
So Alchemix automates this process; where's the primitive though?
